export default function Footer() {
  const social = css`
    width: 50%;
    float: right;
    font-family: 'Karla', sans-serif;
  `;

  const inst = css`
    float: right;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: lightblue;
    font-size: 16px;
    width: 20%;
  `;

  const tweet = css`
    float: right;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: #f7b733;
    font-size: 16px;
    width: 20%;
  `;

  const support = css`
    float: right;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: #4abdac;
    font-size: 0.8em;
    width: 40%;
    font-family: 'Comfortaa', cursive;
  `;

  const linked = css`
    float: right;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: lightblue;
    font-size: 20%px;
    width: 20%;
  `;

  const paragh = css`
    padding-left: 5%;
    color: white;
    font-size: 14px;
    letter-spacing: 1px;
    background-color: #999;
    padding-top: 10px;
    padding-bottom: 15px;
  `;

  const copyright = css`
    float: left;
    font-family: 'Comfortaa', cursive;
    background-color: #999;
    width: 50%;
  `;

  const footer = css`
    width: 100%;
    display: inline-block;
    height: 50px;
    background-color: #999;
    bottom: 0;
    height: 1rem;
  `;

  return (
    <>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Major+Mono+Display&display=swap');
      </style>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Comfortaa&family=Righteous&display=swap');
      </style>
      <footer css={footer}>
        <div css={copyright}>
          <p css={paragh}>&copy; 2020 - SÃ¡nchez</p>
        </div>
        <div css={social}>
          <Link href={'/contact'}>
            <a href="#a" css={support}>
              Contact Us
            </a>
          </Link>
          <a href="https://github.com/Sanchez-Gabriela" css={inst}>
            g
          </a>
          <a href="https://twitter.com/gab_veg" css={tweet}>
            t
          </a>
          <a href="#a" css={linked}>
            in
          </a>
        </div>
      </footer>
    </>
  );
}
